import React, { Component } from 'react'

import './home.css'

class Home extends Component {
    render() {
        return (
            <div>
                <h1>NBA STATS</h1>
                <div>
                    <div className='homeDiv' onClick={ () => {
                        this.props.history.push("/teamList")
                    } }>TEAMS</div>
                    <div className='homeDiv'>PLAYERS</div>
                    <div className='homeDiv'>GAMES</div>
                </div>
            </div>
        );
    }
}

export default Home;
